export const login = userEmail => ({
	type: 'LOGIN_USER',
	payload: userEmail,
});
const logout = () => ({
	type: 'LOGOUT_USER',
});

const signOut = ( userEmail, userPassword ) => ({
	type: 'IS_REGISTERED',
});
